import React from "react";
import { useState, useEffect } from "react";
import Users from "./components/users";
import "./App.css";

const App = (props) => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    await fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((data) => setUsers(data))
      .catch((err) => {
        console.log(err);
      });
  };

  const onAdd = async (name, email) => {
    await fetch("https://jsonplaceholder.typicode.com/users", {
      method: "POST",
      body: JSON.stringify({
        name: name,
        email: email,
      }),
      headers: {
        "content-type": "application/json",
      },
    }).then((res) => {
      if (res.status !== 201) {
        return;
      } else {
        return res.json;
      }
    });
  };
  console.log(users);

  return (
    <div className="form">
      <div>
        {users.map((user) => (
          <Users
            id={user.id}
            key={user.id}
            name={user.name}
            email={user.email}
          />
        ))}
      </div>
    </div>
  );
};

export default App;
